import { FunctionComponent } from "react";
import { NavLink } from "react-router-dom";
import Logo from "../Components/Atoms/Logo";

import Cover from '../Assets/Images/a-zorg-banner-over-ons-1.jpg';

const Home: FunctionComponent = () => {
    return (
        <div className="home-cover">
            <img src={Cover} style={{ marginLeft: '2rem', marginRight: '2rem' }} />


            <div className="home-buttons">
                <h1>
                    Autonomous Exploration
                </h1>
                <Logo />
                <NavLink className="m-top" to="/livevideo">
                    <button className="home-cover-button">Live Video</button>
                </NavLink>
                <NavLink to="/over-ons">
                    <button className="home-cover-button">Over ons</button>
                </NavLink>
            </div>
        </div>
    );
}

export default Home;
